import './Ball.css'

function Ball(props) {
    return (
        <img src= "https://clipart.info/images/ccovers/1495749720Bowling-Ball-PNG-Clip-Art.png"
        style= {{height: props.ballSize, 
            top: props.yPos}} 
            id= "ball-image"
            className = 'Ball'
            alt = "ball"/>
    )
}

export default Ball
